import logo from './logo.svg';
import './App.css';
import React from 'react';

function App() {
  class clickCounter extends React.Component{
    constructor(props){
      super(props);
      this.state = {clicks : 0};
    }


  render(){
  return <div id='quiz' onClick={() => {this.setState({clicks : this.state.clicks + 1});}}>
  This div has been clicked {this.state.clicks} times.



</div>;
 }
}

}

export default App;
